function openWindowWithData(data) {
    const newWindow = window.open('', '_blank', 'width=400,height=300');
    newWindow.document.write('<html><head><title>Data Window</title></head><body>');
    newWindow.document.write('<h1>Data Window</h1>');
    newWindow.document.write('<p>' + data + '</p>');
    newWindow.document.write('</body></html>');
    newWindow.document.close();
  }

  // Example usage

export default openWindowWithData;
